import{_ as e,o as i,c as t,O as a}from"./chunks/framework.9482e208.js";const u=JSON.parse('{"title":"§ 6.2-933 Distribution of assets.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/6.2-933.md","filePath":"vacode/6.2-933.md"}'),s={name:"vacode/6.2-933.md"},o=a('<h1 id="§-6-2-933-distribution-of-assets" tabindex="-1">§ 6.2-933 Distribution of assets. <a class="header-anchor" href="#§-6-2-933-distribution-of-assets" aria-label="Permalink to &quot;§ 6.2-933 Distribution of assets.&quot;">​</a></h1><p>A. All claims against the bank&#39;s estate, proved to the satisfaction of the FDIC as receiver or approved by the receivership court, shall be paid in the following order:</p><ol><li><p>Administration expenses of the liquidation;</p></li><li><p>Claims given priority under other provisions of state or federal law;</p></li><li><p>Deposit obligations;</p></li><li><p>Other general liabilities;</p></li><li><p>Debt subordinated to the claims of depositors and general creditors; and</p></li><li><p>Equity capital securities.</p></li></ol><p>B. No interest on any claim shall be paid until all claims within the same class have received the full principal amount of claim.</p><p>1983, c. 507, § 6.1-110.9; 2010, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?101+ful+CHAP0794" target="_blank" rel="noreferrer">794</a>.</p>',5),r=[o];function l(n,p,c,d,_,h){return i(),t("div",null,r)}const m=e(s,[["render",l]]);export{u as __pageData,m as default};
